Wizards of Waverly Place is a Disney Channel Original television series that premiered on October 12, 2007. It won the Primetime Emmy Award for &quot;Outstanding Children's Program&quot; in 2009 and again in 2010 for its television film adaption. The series was created by Todd J. Greenwald, and stars Selena Gomez, David Henrie and Jake T. Austin as three wizard siblings with magical abilities. Further main cast includes Jennifer Stone, Maria Canals Barrera and David DeLuise.


